Ovviamente i vector sono dei tipi come altri, quindi possono essere passati come parametro di una funzione senza problemi. Però, quando un parametro viene passato ad una funzione, esso viene copiato per fare in modo che la funzione non possa modificare la copia originale di quella variabile ma riceva una copia tutta per sè. Poichè i vector possono essere costosi da copiare, conviene prevenirlo mettendo una & dopo il tipo del parametro della funzione, per dire al compilatore di passare tale parametro per reference , ovvero non copiarlo. Però passare parametri alle funzioni senza copiarli può permettere alle funzioni di modificare le variabili che passiamo loro; se vogliamo evitare ciò (ad esempio perchè una funzione che scrive a schermo non deve modificare il contenuto del vettore che gli passiamo) possiamo mettere un const prima del tipo del parametro. // quando questa funzione viene chiamata, il vettore passato
// al posto di `v` viene copiato (operazione costosa)
void printVettore(vector<int> v) { for (int i = 0; i < v.size(); ++i) { cout << v << " "; } cout << endl;
} // quando questa funzione viene chiamata, il vettore passato al posto
// di `v` non viene copiato ma la funzione ne ha accesso diretto
void printVettoreOttimizzato(const vector<int>& v) { v.push_back(5); // errore! `v` e' dichiarato const, quindi non puo' essere modificato for (int i = 0; i < v.size(); ++i) { cout << v << " "; // tuttavia possiamo leggerlo liberamente. } cout << endl;
} // questa funzione aggiunge un elemento sia ad `a` che a `b`, ma solo
// la modifica a b viene recepita dal chiamante, perche' a e'
// stato copiato prima di venir modificato, b invece no.
void modificaSecondoVettore(vector<int> a, vector<int>& b) { a.push_back(-1); b.push_back(-1); cout << "Vettore a in modificaSecondoVettore: "; printVettoreOttimizzato(a); cout << "Vettore b in modificaSecondoVettore: "; printVettoreOttimizzato(b);
} int main() { vector<int> a{0,1,2,3}; vector<int> b{9,8,7}; cout << "Vettore a all'inizio: "; printVettore(a); // a viene copiato, costoso! cout << "Vettore b all'inizio: "; printVettoreOttimizzato(b); // b non viene copiato modificaSecondoVettore(a, b); cout << "Vettore a nel main: "; printVettoreOttimizzato(a); // uguale all' a originale cout << "Vettore b nel main: "; printVettoreOttimizzato(b); // modificato
}

