Facciamo finta di dover trovare tutte le sequenze formate da 4 palline che chiameremo a, b, c e d. Indichiamo il sacchetto delle palline con {a, b, c, d} Modellizziamo il problema dal punto di vista delle scelte : Inizialmente abbiamo una sequenza nulla, possiamo selezionare una qualsiasi delle palline dal sacchetto. Abbiamo 4 possibilità. Facciamo finta di aver selezionato la pallina a, otteniamo una sequenza a e nel sacchetto rimangono {b, c, d}. Per la seconda pallina scegliamo b, sequenza ab e sacchetto {c, d}. Esaurendo le scelte otteniamo abcd con sacchetto {}. Abbiamo ottenuto la prima sequenza completa. Torniamo indietro, rimuoviamo d ottenendo abc e {d}. Non abbiamo altre scelte, torniamo ancora indietro ed otteniamo ab e {c, d}. A questo punto possiamo fare un'altra scelta: selezioniamo prima d, ottenendo abd e {c} e poi abbiamo la scelta obbligata che ci porta ad ottenere abdc. Possiamo ripetere questo "tornare indietro e provare altre scelte" per ottenere tutte le possibili soluzioni. Chiamiamo questo algoritmo backtracking . Da un punto di vista implementativo il "tornare indietro" si può implementare con funzioni ricorsive . Viene utilizzato sia per problemi di esplorazione (proviamo tutte le possibilità per trovare le varie soluzioni e poi valutarle) sia problemi enumerativi (dobbiamo elencare tutte le possibilità). La tecnica backtracking è tendenzialmente inefficiente (produce soluzioni super esponenziali), tuttavia può essere un punto di partenza da raffinare. Un algoritmo generico può essere espresso rappresentato da questa funzione: // Questo è un pseudocodice. Non è scritto in C++. // Prendiamo i dati del problema, la soluzione (sequenza di scelte parziali) e dati derivati in seguito alle scelte.
function backtracking(dati_problema, soluzione_parziale, dati_parziali, ...) { // Non ci sono più scelte disponibili oppure abbiamo un altro modo per stabilire se siamo giunti in una soluzione. if (fine(...)) { // Siamo giunti ad una "soluzione", gestiamola. return processa_soluzione(...); } // Generiamo le possibili scelte che possiamo fare in base allo stato attuale. possibili_scelte = genera_scelte(...); // Proviamo tutte le scelte. for (scelta : possibili_scelte) { // Facciamo tutte le modifiche comportate dalla scelta effettua_scelta(scelta); // Salviamo il valore di ritorno del sottoproblema in seguito a questa scelta, possiamo gestirlo oppure anche non fare nulla, dipende dal problema. auto result = backtracking(dati_problema, soluzione_parziale_aggiornata, dati_parziali_aggiornati, ...); // Ripristiniamo le modifiche comportate dalla scelta (se non locali). ripristina_scelta(scelta); }
}

