std::vector<Veicolo> veicoli = ...; // La soluzione migliore trovata fino a questo momento.
int costo_minimo = std::numeric_limits<int>::max(); // Funzione ricorsiva che implementa il backtracking.
// Ha accesso ai vari `veicoli`, al numero di persone rimaste in attesa e ai soldi spesi fino a questo momento.
void laurea(int persone_in_attesa, int soldi_spesi) { // Non ci sono più persone in attesa, non dobbiamo spendere nient'altro. // Il numero di persone in attesa può essere negativo: // ci permette di evitare di gestire a parte casi con veicoli più grandi del numero di persone rimanenti, // tanto il risultato è lo stesso in termini economici. if (persone_in_attesa <= 0) { // Il valore associato a questa soluzione è il numero di `soldi_spesi` (è la quantità che vogliamo minimizzare). // Aggiorniamo la soluzione ottima. costo_minimo = std::min(costo_minimo, soldi_spesi); return; } // Possiamo scegliere uno qualsiasi dei veicoli disponibili. for (const Veicolo& veicolo : veicoli) { if (veicolo.numero <= 0) continue; // "Consumiamo" un veicolo. --veicolo.numero; // Cerchiamo la soluzione migliore per le persone e i veicoli rimanenti. laurea(persone_in_attesa - veicolo.posti, soldi_spesi + veicolo.costo); // Ripristiniamo l'uso del veicolo. ++veicolo.numero; }
}

