std::vector<bool> tessere_usate(N, false); // Funzione ricorsiva che implementa il backtracking.
// Abbiamo accesso alle tessere rimanenti. Ci interessa l'estremo a cui attaccare le altre tessere.
// In questo esempio propaghiamo la soluzione all'indietro: si poteva fare anche in `laurea`.
// Il domino può iniziare con qualsiasi `estremo`: ce lo giochiamo esternamente provando tutte le possibilità.
int domino(int estremo) { // Non abbiamo una soluzione finale. // Semplicemente se non riusciamo a fare nessun'altra scelta allora la sequenza successiva attaccabile più lunga sarà lunga 0. // La lunghezza massima della sequenza attaccabile. int massima_lunghezza_attaccabile = 0; // Possiamo scegliere fra una qualsiasi delle tessere attaccabili e non ancora utilizzata. for (int i = 0; i < N; ++i) { // Se la tessera è già stata usata o se non è attaccabile allora non la possiamo scegliere. if (tessere_usate.at(i) || non_attaccabile(estremo, tessere.at(i))) continue; // Segnamo la tessera come usata. tessere_usate.at(i) = true; // Prendiamo la lunghezza massima costruibile usando questa tessera. +1 dovuto a questa tessera. int lunghezza = domino(estremo_opposto(estremo, tessere.at(i))) + 1; // Aggiorniamo la massima lunghezza. massima_lunghezza_attaccabile = std::max(massima_lunghezza_attaccabile, lunghezza); // Ripristiniamo la tessera. tessere_usate.at(i) = false; } // È ancora a 0 se non siamo riusciti ad attaccare alcuna tessera. return massima_lunghezza_attaccabile;
}

