Dati due input di uguale dimensione NON è detto che uno stesso algoritmo impieghi lo stesso tempo. Ci sono alcuni input "più buoni di altri". I cosiddetti caso ottimo , caso medio e caso pessimo possono avere complessità differenti. Per esempio, dato un algoritmo per la ricerca di un elemento in un vector: bool contiene(const vector<int>& v, int elemento) { for (int e : v) { if (e == elemento) { // Il return termina l'esecuzione della funzione. return true; } } return false;
} \(N\) è la dimensione di v (v.size()). È possibile osservare che se l'elemento da cercare è in prima posizione, allora l'algoritmo terminerà subito. Questo è il caso ottimo . Se l'elemento da cercare è in ultima posizione (o non esiste) allora l'algoritmo deve scorrere tutto il vettore prima di terminare. Questo è il caso pessimo . Negli altri casi, in media, l'elemento si troverà all'incirca a metà del vettore. Questo NON è il caso medio . Il caso medio deve comprendere anche il caso ottimo e il caso pessimo. Tuttavia la media è relativa alla frequenza con cui possono avvenire certi eventi.
In particolare bisognerebbe conoscere la probabilità con cui un elemento non si trova all'interno del vettore per conoscere l'impatto del caso pessimo.
Non possiamo nemmeno dare per scontato che tutti gli elementi abbiano la stessa probabilità di dover essere cercati. Il caso medio è spesso intrattabile. Per quanto riguarda il caso ottimo: non possiamo aspettarci che il CMS (il programma che valuterà le soluzioni) sia così gentile da darci solo casi ottimi. Quindi il nostro obiettivo sarà quello di ottimizzare il caso pessimo . Un algoritmo con caso pessimo peggiore di un altro può in realtà essere migliore nella maggioranza dei casi!
